  input: '"TEXT","F3XN","C00172510","This report does not reflect any salary payments
    because no employees have spent 25 percent or more of their time during any reporting
    period on activities in connection with a federal election.  All salaries to this
    point have therefore been appropriately paid from the Committees non-federal accounts.  Nonetheless,
    the Committee elected to begin filing monthly reports during the second half of
    2003.  The telemarketing expenses disclosed on Schedule B are activities that
    do not refer to any clearly identified candidate for federal office, nor do they
    promote, support, attack or oppose any candidate for federal office.  Therefore,
    none of these expenditures represent in-kind contributions, independent expenditures,
    or coordinated expenditures.  Redesignation letters have been received for Irenee
    Dupont, Michele Rollins and Lammot Copeland.  The redesignated amounts have been
    appropriately transferred to the Committees non-federal account in January 2004.  Letters
    have been sent to T. Kenneth Cribb and Donald Dinsel requesting the required Employer
    and Occupation information.  In this way, we believe we are in compliance with
    the best-effort provisions."'
